void leaveEnclosingElement() throws IOException {
  if(tagQ.size() == 0)
    throw new IOException("Tried to exit non-existent enclosing element " +
              "in FSImage file");

  ImageElement element = tagQ.pop();
  write("</" + element.toString() + ">\n");
}
